    axios.get('https://uxcandy.com/~shapoval/test-task-backend/v2/?developer=ilia&page=2&username=lapapafni').then((data) => console.log(data.data.message.tasks))

    return (

        <form style={{paddingTop: 100, maxWidth: 500, margin: 'auto'}} >
            <div className="mb-3">
                <label htmlFor="email" className="form-label">Example textarea</label>
                <textarea className="form-control" name='text' id="email" rows="3" value={text} onChange={(e) => setText(e.target.value)}/>
            </div>
            <input checked={check} type='checkbox' onChange={() => setChecked(!check)}/> Выполнена?
            <button className="w-100 btn btn-lg btn-primary" type='button'>Sign in</button>
        </form>

    )
}
